import React from 'react';
import Home from "./Home";

export default function UserList ( {contacts} ){
    return(
        <div>
            {contacts.map((contact) => (
                <div key={contact.phone}>
                    <input type="text" key={contact.phone}>{contact.first_name}</input>
                    <input type="text" key={contact.phone}>{contact.last_name}</input>
                    <input type="text" key={contact.phone}>{contact.email}</input>
                    <input type="text" key={contact.phone}>{contact.phone}</input>
                </div>
            ))}
        </div>
    )
}
